public class EmployeeData {    private String empName,empId;    private String preHouse,preStreet,preArea,preCity,perHouse,perStreet,perArea,perCity;    public EmployeeData(String empId,String empName,String preHouse,String preStreet,String preArea,                             String preCity,String perHouse,String perStreet,String perArea,String perCity)    {        this.empId=empId;        this.empName=empName;        this.preHouse=preHouse;        this.preStreet=preStreet;        this.preArea=preArea;        this.preCity=preCity;        this.perHouse=perHouse;        this.perStreet=perStreet;        this.perArea=perArea;        this.perCity=perCity;    }    public String getDetails(String empId) {        return empId;    }    public String getEmpId() {        return empId;    }}